B.Oe=new A.b4(B.hZ,["\ud83c\udf1f","Lake Wobegon effect","E9E1FD","Everyone believes they're above average","The \u2018Lake Wobegon effect\u2019 is a cognitive bias where individuals overestimate their own abilities and qualities, believing they are above average compared to others. Named after Garrison Keillor's fictional town where \u2018all the children are above average,\u2019 this effect highlights the tendency for people to rate themselves unrealistically high in areas like intelligence, competence, and attractiveness."],t.l)
B.Og=new A.b4(B.hZ,["\ud83d\udede","The wagon-wheel effect","E5F3FD","Illusion of wheels spinning backwards","It is an optical illusion where a spoked wheel appears to rotate differently from its actual motion. When viewed under certain conditions, such as in film or under stroboscopic light, the wheel may seem to rotate slowly, backward, or stand still, despite moving forward rapidly. It is caused by the timing of visual snapshots relative to the wheel's position, creating misperceptions of its true motion."],t.l)
